    [],nt"revision_timestamp": "2016-07-20T03:24:03.469552",nt"name": "rotasonic-coastal-plain-rotasonic-boreholes-acquired-within-the-lower-coastal-plain-of-south-c",nt"isopen":
    false,nt"url": null,nt"notes": "In 1999, the USGS, in partnership with
    the South Carolina Sea Grant Consortium, began a study to investigate processes
    affecting shoreline change along the northern coast of South Carolina, focusing
    on the Grand Strand region. Previous work along the U.S. Atlantic coast shows that
    the structure and composition of older geologic strata located seaward of the coast
    heavily influences the coastal behavior of areas with limited sediment supply, such
    as the Grand Strand. By defining this geologic framework and identifying the transport
    pathways and sinks of sediment, geoscientists are developing conceptual models of
    the present-day physical processes shaping the South Carolina coast. The primary
    objectives of this research effort are: 1) to provide a regional synthesis of the
    shallow geologic framework underlying the coastal upland, shoreface and inner continental
    shelf, and define its role in coastal evolution and modern beach behavior; 2) to
    identify and model the physical processes affecting coastal ocean circulation and
    sediment transport, and to define their role in shaping the modern shoreline; and
    3) to identify sediment sources and transport pathways; leading to construction
    of a regional sediment budget.",nt"license_title": null,nt"extras": [{ntt"key":
